import React from 'react';
import WorkTiles from '../components/widgets/workTiles';
import Navbar from '../components/widgets/Navbar';

class Work extends React.Component{
    render(){
        return(
            <div>
                <Navbar />
                <WorkTiles />
            </div>
        );
    }
}

export default Work;
